import React from 'react';

const Footer = () => {
    const footerStyle = {
        backgroundColor: '#3D938B',
        flex: '0 0 50px',
        marginTop: 'auto'
    };

    return (
        <footer style={footerStyle}>
            {/* Your content here */}
        </footer>
    );
}

export default Footer;
